import styles from './Header.module.scss'
import { Name } from "./Name";
import { HeaderButton } from "./HeaderButton";

const Header = (props) => {
    console.log(props)
    const ref1 = props.ref1
    const ref2 = props.ref2
    const ref3 = props.ref3
    const ref4 = props.ref4
    const ref5 = props.ref5
    return (
        <div className={styles.Header}>
            <Name />
            <div className={styles.Header__ButtonsBlock}>
                <HeaderButton refElem={ref1} text="About us" />
                <HeaderButton refElem={ref2} text="Course" />
                <HeaderButton refElem={ref3} text="Pricing plans" />
                <HeaderButton refElem={ref4} text="Feedbacks" />
                <HeaderButton refElem={ref5} text="Contact us" />
            </div>
        </div>
    )
}

export {Header}
